        <div className={ClassNames(cls.testCard, {[cls.disabled]: disabled}, [className])}>
            <img src={Image} alt="" className={ClassNames(cls.img, {[cls.disabled]: disabled}, [])}/>
            <div className={cls.block}>
                <h2 className={cls.title}>
                    Персональные данные
